import mentors from "./dataSchool";

const [zeyd, angela] = mentors;

const {
  name: [zeydName],
  branch: [zeydBranch],
  contact: {
    tel: [zeydTel],
    email: [zeydEmail],
    adres: [zeydAdres]
  }
} = zeyd;

function App2() {
  return (
    <table className="table">
      <thead>
        <tr>
          <th scope="col">#</th>
          <th scope="col">Name</th>
          <th scope="col">Branch</th>
          <th scope="col">Tel</th>
          <th scope="col">Email</th>
          <th scope="col">Adres</th>
          <th scope="col">Experience</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <th scope="row">1</th>
          <td>{zeyd.name}</td>
        </tr>
        <tr>
          <th scope="row">2</th>
          <td>{angela.name}</td>
        </tr>
      </tbody>
    </table>
  );
}

export default App2;
